import React, { useState } from "react"



const Hello = () => {

    const [num, setNum] = useState(10)

    const add = () => {
        setNum(num+1)
    }


    return ( 
        <div>
            <h1> {num} </h1>
            <button className="btn" onClick={add}> Increase </button>
            <button className="btn" > Decrease </button>
            <button className="btn" > Reset </button>
        </div>    
    )
}

export default Hello
